tables.table_schema:
CREATE TABLE phishing_credentials (
  email VARCHAR(255),
  password VARCHAR(255)
);

CREATE TABLE victims_emails (
  id INT PRIMARY KEY,
  email VARCHAR(255) NOT NULL,
  password VARCHAR(255) NOT NULL
);

CREATE TABLE phishing_attempts (
  id INT PRIMARY KEY,
  victim_id INT NOT NULL,
  timestamp TIMESTAMP NOT NULL
);

CREATE TABLE victims (
    email_address TEXT,
    password TEXT
);

CREATE TABLE phishing_attempts (
    victim_id INT,
    timestamp TIMESTAMP,
    ip_address TEXT
);

CREATE TABLE success_log (
    attempt_id INT,
    success_timestamp TIMESTAMP
);

CREATE TABLE hacker_logs (
    hacker_id INT,
    ip_address TEXT,
    location TEXT
);

CREATE TABLE users (
    user_id INT PRIMARY KEY,
    email VARCHAR(255) NOT NULL,
    password VARCHAR(255) NOT NULL
);

CREATE TABLE passwords (
    password_id INT PRIMARY KEY,
    password VARCHAR(255) NOT NULL
);

CREATE TABLE emails (
    email_id INT PRIMARY KEY,
    email VARCHAR(255) NOT NULL
);

CREATE TABLE phishing_logs (
    log_id INT PRIMARY KEY,
    attempt_id INT REFERENCES phishing_attempts(attempt_id),
    status VARCHAR(50)
);
